const { files } = window.data

export const File = ({ file = files, name }) => {
  return <div
    style={{
      display: "flex",
      flexDirection: "column"
    }}
  >
    {file.type === `folder` ? <>
      {Object.entries(file).map(([key, value]) => {
        return <File
          file={value}
          name={key}
        />
      })}
    </> : <>
      {name}
    </> }
  </div>
}
